import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";

// Example of setting up CORS for fetch requests globally
const fetchWithCors = (url, options = {}) => {
	return fetch(url, {
		...options,
		headers: {
			...options.headers,
			"Access-Control-Allow-Origin": "*",
		},
	});
};

// Example usage:
// fetchWithCors("https://example.com/api", { method: "GET" }).then(response => response.json());

const root = ReactDOM.createRoot(
	document.getElementById("root")
);
root.render(
	<React.StrictMode>
		<App />
	</React.StrictMode>
);
